import{setActiveLink,handleSidebar}from"./utils.min.js";!function(){setActiveLink(),handleSidebar();document.querySelector("#connect-google-services-form").addEventListener("submit",(async e=>{e.preventDefault();const t=e.target.googlesheet.checked,o=e.target.googledrive.checked;try{const e=await fetch(`/auth-google-service?google_sheet=${t}&google_drive=${o}`),c=await e.json();200===e.status?window.location.replace(c.url):console.log(c)}catch(e){console.log(e)}}))}();